INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 100, "", 0, 40000, 0, 91002, 0, 36, "", 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 0, 40001, 1, 91002, 107501, 37, "ぺコリーヌ", 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 0, 40001, 1, 91002, 107601, 38, "コッコロ", 2);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 0, 40001, 1, 91002, 107801, 39, "キャル", 3);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 0, 40001, 1, 91002, 107701, 40, "スズメ", 4);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 0, 40001, 1, 91002, 107901, 41, "タマキ", 5);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 0, 40001, 2, 91002, 107501, 42, "ぺコリーヌ", 6);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 0, 40001, 2, 91002, 107601, 43, "コッコロ", 7);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 0, 40001, 2, 91002, 107801, 44, "キャル", 8);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 0, 40001, 2, 91002, 107701, 45, "スズメ", 9);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 150, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 0, 40001, 2, 91002, 107901, 46, "タマキ", 10);
