INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 40011, 1, 24001, 125801, 321, "リリ", 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 40011, 1, 24001, 126001, 322, "クリア", 2);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "んーと。\nこれ、あげる。\nはい", 0, 40011, 1, 24001, 126101, 323, "プレシア", 3);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 40011, 2, 24001, 125801, 324, "リリ", 4);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 40011, 2, 24001, 126001, 325, "クリア", 5);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, "お兄。\nきてくれて、うれしい", 0, 40011, 2, 24001, 126101, 326, "プレシア", 6);
